test_list_of_tens:
assert {2, 3, 4, 5, 6, 7, ...} == {2, 5}
  Extra items in the left set:
  3
  4
  6
  7
  8
  Full diff:
  - {2, 5}
  + {2, 3, 4, 5, 6, 7, 8}

